import { createSlice } from "@reduxjs/toolkit";

const userReducer = createSlice({
    name: 'users',
    users: [
        { id: 1, name: 'Asif' },
        { id: 2, name: 'Asif Gul' },
        { id: 3, name: 'Laila' }


    ]
})

export default userReducer;
